                `MSG_TYPE_SWAPWB_P1_REQ, `MSG_TYPE_SWAPWB_P2_REQ,
                `MSG_TYPE_AMO_ADD_P1_REQ, `MSG_TYPE_AMO_ADD_P2_REQ,
                `MSG_TYPE_AMO_AND_P1_REQ, `MSG_TYPE_AMO_AND_P2_REQ,
