    state_owner_op_S2 = cs_S2[`CS_STATE_OWNER_OP_P1S2];
end


always @ *
begin
    state_subline_en_S2 =  cs_S2[`CS_STATE_SL_EN_P1S2];
end

always @ *
begin
    state_subline_op_S2 = cs_S2[`CS_STATE_SL_OP_P1S2];
end


